import React from 'react';

const Hero = (props) => {
    return (
        <header>
            <h2>{props.title}</h2>
            <h3>{props.subTitle}</h3>
            <p>{props.text}</p>
            <button className="secondary">View Projects</button>
        </header>
    );
}

export default Hero;
